$(document).ready(function () {

    const token = localStorage.getItem('token');
    const user = localStorage.getItem('name');
    const id = localStorage.getItem('id');

    // Nombre de usuario
    $('.dropdown-toggle').html(`<i class="fa-solid fa-user"></i> ${user}`);

    /*
    toastr.error('probando');
    toastr.warning()
    toastr.success()
    toastr.error()
    toastr.clear()
    */
   
    // Pagina-TAB activo
    $('.main-menu a').each(function(){
        if(this.href === window.location.href) {
            $(this).addClass('active-tab');
        }
    });

    // TODO
    listaSolicitudes(token);

    callResponsables(token);

    callStates();

    $('#states').change(function (e) { 
        e.preventDefault();
        callMunicipalities(this.value);
    });
    
    callEjes();
    
    callRubros();
    
    // Change -> Modal - Button
    $('#actionssolicitud button').each(function () {
        $(this).mouseenter(function () { 
            if(this.id == 'readsolicitud' || this.id == 'updatesolicitud') {
                $(this).attr('data-target', `#${this.id}Modal`);
                $(this).attr('data-toggle', `modal`);
                $('.modal').attr('id', `${this.id}Modal`);
                $('.modal-header').html(`
                <h5 class="modal-title">
                ${(this.id === 'readsolicitud')
                ? (`<h5 class="modal-title">Ver Solicitud</h5>
                        <button type="button" class="close" data-dismiss="modal" aria-label="Close">
                        <span aria-hidden="true">&times;</span>
                    </button>`) 
                : (`<h5 class="modal-title">Actualizar Solicitud</h5>
                        <button type="button" class="close" data-dismiss="modal" aria-label="Close">
                        <span aria-hidden="true">&times;</span>
                    </button>`)
                }
                `);
            }
            if(this.id == 'readsolicitud') {
                onlyReadModal();
            } else {
                $('#nueva-solicitud input').each(function () {
                    $(this).attr('disabled', false);
                });
                $('#nueva-solicitud select').each(function () {
                    $(this).attr('disabled', false);
                });
                $('#nueva-solicitud textarea').each(function () {
                    $(this).attr('disabled', false);
                });
                $('#vehicleSelectButton').attr('disabled', false);
                $('#nuevasolicitud-button').attr('disabled', false);
            }
        });
    });
    
    listaAutos(token);
    
    //! Nuevo Registro - Modal
    // $('#createsolicitud').click(function (e) { 
    //     e.preventDefault();
    //     nuevaSolicitud(this);
    // });
    
    $('#vehicleSelectButton').mouseenter(function () { 
        const modalCar = $('#vehicleSelect').find('div').first();
        $(modalCar).attr('id', this.dataset.target.split('').slice(1).join(""));
        $('#vehicleSelect').find('.modal-header').html(`
            <h5 class="modal-title">Elija vehículo</h5>
        `);
    });

    $('#cerrar-autos').click(function (e) { 
        e.preventDefault();
        $('#labelcar').val('');
    });
    
    // Mantener primer modal abierto
    $('#second-modal-footer button').each(function () {
        $(this).click(function (e) { 
            e.preventDefault();
            if(this.id === 'ok-autos') {
                $('#vehicleSelectModal').modal('hide');
                setTimeout(() => {
                    $('body').addClass('modal-open');
                }, 500);
            } else {
                $('#vehicleSelectModal').modal('hide');
                setTimeout(() => {
                    $('body').addClass('modal-open');
                }, 500);
            }
        });   
    });
    
    // Vistas modal (personas, compromisos, adjuntos)
    $('.tab-modal button').each(function () {
        $(this).click(function (e) {
            if(this.id === 'relacion') {
                relacionTAB(this.id)
            }
            if(this.id === 'pago') {
                relacionTAB(this.id)
            }
            if(this.id === 'adjuntos') {
                relacionTAB(this.id)
            }
        });
    });
    
    $('#add-responsable input').each(function (index, element) {
        $(this).change(function (e) { 
            $('#codigo').val();
            $('#nombre').val();
            console.log($('#codigo').val().length === 9);
            if($('#codigo').val().length === 9 &&  $('#nombre').val().length > 1) {
                $('#add-responsable-button').attr('disabled', false);
            } else {
                $('#add-responsable-button').attr('disabled', true);
            }
        }); 
    });
    
    $('#add-responsable input').each(function () {
        $(this).change(function (e) { 
            validarResponsable();
        });
    });
    
    $('#add-responsable-button').click(function (e) { 
        e.preventDefault();
        appendTable();
    });
    
    $('#delete-responsable-button').click(function (e) { 
        e.preventDefault();
        const tr = localStorage.getItem('responsable');
        $(`#${tr}`).remove();
        $('#delete-responsable-button').attr('disabled', true);
    });

    $('#nuevasolicitud-button').mouseenter(function () { 
        //!validarFormDoc();
    });
    
    // TODO
    $('#nueva-solicitud').submit(function (e) {
        e.preventDefault();
        const id = localStorage.getItem('solicitudId');
        startSavingSolicitud(this, token, id);
    });

    $('#printsolicituddiv').hide();
    $('.dt-search').hide();

    $('#printsolicitud').click(function (e) { 
        e.preventDefault();
        $('.buttons-print').click();
    });

    //! borrar
    // $('#deletesolicitud').click(function (e) { 
    //     e.preventDefault();
    //     const id = localStorage.getItem('solicitudId');
    //     deletingSolicitud(id, token, dataTable);
    // });

    $('#approvesolicitud').click(function (e) { 
        e.preventDefault();
        const id = localStorage.getItem('solicitudId');
        startApprovingSolicitud(token, id);
    });

    $('#cancelsolicitud').click(function (e) { 
        e.preventDefault();
        clearModal();
        const id = localStorage.getItem('solicitudId');
        $('#cancelid').val(id);
        $('#canceltoken').val(token);
    });
    
    $('#cancelform').submit(function (e) { 
        e.preventDefault();
        let formData = new FormData(this);
        formData.append('method', 'request.cancel');
        startCancelingSolicitud(formData);
    });

    $('#refreshsolicitud').click(function (e) { 
        e.preventDefault();
        $('#tablesolicitudes').DataTable().clear().destroy();
        $('#theadsolicitudes').empty();
        $('#tfootsolicitudes').empty();
        $('#loadview').show();
        $('#onLoadSolicitudes').hide();
        listaSolicitudes(token);
    });
    
    $(document).click(function(e){
        if(e.target.localName !== 'td' && e.target.id !== 'updatesolicitud') {
            $('.t-select').removeClass('t-select');
            $('#readsolicitud').attr('disabled', true);
            $('#updatesolicitud').attr('disabled', true);
            $('#deletesolicitud').attr('disabled', true);
            $('#ok-autos').attr('disabled', true);
            localStorage.removeItem('responsable');
            //localStorage.removeItem('solicitudId');
            $('#printsolicitud').attr('disabled', true);
            $('#approvesolicitud').attr('disabled', true);
            $('#cancelsolicitud').attr('disabled', true);
        }
    });
});

const estadoSolicitud = (data) => {
    if(data.isusercreated) {
        if(data.approved || (data.max_authorized_index == data.max_index)) {
            return 'Aprobado';
        } else if(data.cancelled) {
            return 'Cancelado';
        } else {
            return 'En espera de autorización';
        }
    } else {
        if(data.approved || (data.max_authorized_index == data.max_index)) {
            return 'Aprobado';
        } else if(data.cancelled) {
            return 'Cancelado';
        } else if(data.authorized) {
            return 'Autorizado';
        } else {
            if((data.max_authorized_index + 1) == data.current_user_index) {
                return 'Aprobar';
            } else {
                return 'En espera de autorización previa';
            }
        }
    }
}

const conductorSolicitud = (data) => {
    if(!data.driver_name) {
        if((data.current_user_index == data.max_index) && data.requestdrivertolastlevel) {
            return 'Asignar';
        } else {
            return '';
        }
    } else {
        return data.driver_name;
    }
}

function listaSolicitudes(token) {
    renderSolicitudes();
    return;
    $.ajax({
        type: 'POST',
        url: 'https://lionware.dev/services/sgv/webservice/index.php',
        data: {
            method: 'request.select2',
            token,
        },
        dataType: 'json',
        success: function (response) {
            renderSolicitudes(response, token);
        },
        error: function (response) {
            console.log(response);
        }
    });
}

