function vehicleList(response, token) {
    
    let vehiclesIDs = [];   
    $('#vehicle-props').empty();

    response.records.forEach((vh) => {
        vehiclesIDs = [...vehiclesIDs, vh[0]]
    });

    for (let i = 0; i < vehiclesIDs.length; i++) {
        $.ajax({
            type: 'POST',
            url: 'https://lionware.dev/services/sgv/webservice/index.php',
            data: {
                method: 'vehicles.report',
                token,
                id: vehiclesIDs[i],
            },
            dataType: 'json',
            success: function (response) {
                vehicleFormat(response)
            },
            error: function (response) {
                console.log(response);
            }
        });  
    }
}

