function relacionTAB(prop) {

    if(`#${prop}-div` === '#relacion-div') {
        $('#relacion-div').css('display', 'block');
        $('#pago-div').css('display', 'none');
        $('#adjuntos-div').css('display', 'none');
    }
    if(`#${prop}-div` === '#pago-div') {
        $('#relacion-div').css('display', 'none');
        $('#pago-div').css('display', 'block');
        $('#adjuntos-div').css('display', 'none');
    }
    if(`#${prop}-div` === '#adjuntos-div') {
        $('#relacion-div').css('display', 'none');
        $('#pago-div').css('display', 'none');
        $('#adjuntos-div').css('display', 'block');
    }

    $('.tab-modal button').each(function () {
        if(prop === this.id) {
            $(this).removeClass('tab-modal-button');
            $(this).addClass('tab-active');
        } else {
            $(this).removeClass('tab-active');
            $(this).addClass('tab-modal-button');
        }
    });
}

