function onSelected(selected) {

    const token = localStorage.getItem('token');
    
    //!
    if(token == '80610b9757b096268246dafc73ac26b6') {
        $('#readsolicitud').attr('disabled', false);
        $('#updatesolicitud').attr('disabled', false);
        $('#deletesolicitud').attr('disabled', false);
        $('#deletesolicitud').attr('disabled', false);
    } else {
        $('#readsolicitud').attr('disabled', false);
    }

    let idarr = [];
    let ref = [];
    selected.id.split('').forEach((n) => {
        (!isNaN(n)) ? idarr = [...idarr, n] : ref = [...ref, n]
    });
    const item = ref.join('');
    const id = idarr.join('');

    console.log(id);
    console.log(item);
    console.log(selected);

    localStorage.setItem('solicitudId', id);

    $('.t-select').removeClass('t-select');
    $(selected).find('td').addClass('t-select');
    if(id !== '') {
        switch (item) {
            case 'solicitudes':
                getSolicitud(selected, id);
                break;
            case 'vehiculo':
                setVehiculo(selected, id);
                break;
            case 'rubros':
                $(selected).find('input').focus();
                localStorage.removeItem('solicitudId');
                break;
            default:
                break;
        }
    } else {
        localStorage.setItem('responsable', selected.id);
        localStorage.removeItem('solicitudId');
        $('#delete-responsable-button').attr('disabled', false);
    }
}

function setVehiculo(select, id) {
    let auto = [];
    $(select.cells).each(function (i, e) {
        auto = [...auto, this.innerText]
    });
    $('#labelcar').val(auto.slice(2).join(' '));
    $('#vehicle').val(id);
    $('#ok-autos').attr('disabled', false);
    localStorage.removeItem('solicitudId');
}

