function validarFormDoc() {

    let errores = 0;
    $(`#nueva-solicitud input`).each(function () {
        if(this.value === '' && this.id !== 'codigo' && this.id !== 'nombre' && this.id.split('').reverse().slice(0,15).reverse().join('') !== 'items[0][value]' && this.id !== 'adjuntos') {
            $(this).addClass('is-invalid');
            errores++;
            //console.log(this.id.split('').reverse().slice(0,15).reverse().join(''));
            //Swal.fire('<h3>Campos Obligatorios<span style="color:red">*</span></h3>');
        }
        $(this).change(function (e) { 
            $(this).removeClass('is-invalid');
        });
    });

    $(`#nueva-solicitud select`).each(function () {
        if(this.value === '' && this.id !== 'state' && this.id !== 'municipality' && this.id !== 'driver') {
            $(this).addClass('is-invalid');
            errores++;
            //Swal.fire('<h3>Campos Obligatorios <span style="color:red">*</span></h3>');
        }
        $(this).change(function (e) { 
            $(this).removeClass('is-invalid');
        });
    });

    $(`#nueva-solicitud textarea`).each(function () {
        if(this.value === '') {
            $(this).addClass('is-invalid');
            errores++;
            //Swal.fire('<h3>Campos Obligatorios <span style="color:red">*</span></h3>');
        }
        $(this).change(function (e) { 
            $(this).removeClass('is-invalid');
        });
    });

    if(errores > 0) {
        Swal.fire('<h3>Campos Obligatorios <span style="color:red">*</span></h3>');
    }
}

