function startSavingSolicitud(prop, token, id) {

    let formValues = new FormData(prop);

    $('#nuevasolicitud-button').html('<span class="spinner-border spinner-border-sm" role="status" aria-hidden="true"></span> Guardando...')
    $('.modal-content button').each(function () {
        $(this).attr('disabled', true);
    });
    onlyReadModal();

    $('#compromisos-tb input').each(function () {
        if(this.value !== '') {
            formValues.append('items[0][item]', this.id.split('').reverse().slice(15).reverse().join(''));
            formValues.append(this.id.split('').reverse().slice(0,15).reverse().join(''), Number(this.value).toFixed(2))
        } else {
            formValues.append('items[0][item]', this.id.split('').reverse().slice(15).reverse().join(''));
            formValues.append(this.id.split('').reverse().slice(0,15).reverse().join(''), '0');
        }
    });

    $('#nueva-solicitud input').each(function () {
        if(this.type == 'datetime-local') {
            if(this.id == 'departuredate') formValues.set('departuredate', this.value.replace(/T/g, ' '));
            if(this.id == 'eventdate') formValues.set('eventdate', this.value.replace(/T/g, ' '));
            if(this.id == 'returndate') formValues.set('returndate', this.value.replace(/T/g, ' '));
        }
    });

    if(id == null) {
        formValues.append('method', 'request.create');
        formValues.append('token', token);
        formValues.append('program', 1);         //!
        formValues.append('driver', '');          //!
        createUpdateSolicitud(formValues, id);
    } else {
        let formUpdate = new FormData();
        formUpdate.append('method', 'request.update');
        formUpdate.append('token', token);
        formUpdate.append('id', id);
        formUpdate.append('vehicle', $('#vehicle').val());
        createUpdateSolicitud(formUpdate, id);
    }
}

function createUpdateSolicitud(FormData, id) {

    console.log(FormData);
    $.ajax({
        type: 'POST',
        url: 'https://lionware.dev/services/sgv/webservice/index.php',
        data: FormData,
        contentType: false,
        cache: false,
        processData: false, 
        dataType: 'json',
        success: function (response) {
            if(response.status == 'error') {
                handleError(response);
                console.log(response);
                return;
            }
            afterCRUD(response, id);
        },
        error: function (response) {
            handleError(response);
            console.log(response);
        }
    });
}

function handleError(response) {

    console.log(response);
    
    //$('.modal').modal('hide');
    //clearModal();
    localStorage.removeItem('solicitudId');

    $('#nuevasolicitud-button').html('<i class="fa-solid fa-floppy-disk"></i> Guardar cambios.')
    $('.modal-content button').each(function () {
        $(this).attr('disabled', false);
    });

    if(response.status == 0 || response.status == 'error') {
        Swal.fire({
            icon: "error",
            title: "Ha ocurrido un error",
            text: response.message,
        });
    } else {
        Swal.fire({
            icon: "error",
            title: "Ha ocurrido un error",
        });
    }
}

